import React from 'react'
import './Nav.css'
import {NavLink} from 'react-router-dom'

const Nav=()=>{
    function click(){
        var x=document.getElementById('form')
        if(x.style.display=='none'){
          x.style.display='block'
         
        }
           else{
          x.style.display='none'
        }
       }
    return(
        <body>
        <section className='navbar'>
            <div class='navbar1'>
                <a>HariCharan</a>
            </div>
            <div class='navbar2'>
            <a><NavLink to='/' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Home</NavLink></a>
<a><NavLink to='/About' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>About</NavLink></a>
<a><NavLink to='/Servive' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Servive</NavLink></a>

            </div>
          <div className='navbar3'>
        <button onClick={click}><link to='/'>Login/Signup</link></button>
            </div>
          
        </section>
        
       </body> 
          
    );
}
export default Nav;
